interactions with the origin server.

For more information about manifest service logs, including
descriptions of the event types, see MediaTailor manifest logs
description and event types
(https://docs.aws.amazon.com/mediatailor/latest/ug/log-types.html) in
Elemental MediaTailor User Guide.

=head1 ATTRIBUTES


=head2 ExcludeEventTypes => ArrayRef[Str|Undef]

Indicates that MediaTailor won't emit the selected events in the logs
for playback sessions that are initialized with this configuration.



